import React, { Component } from 'react'

export class AddTodo extends Component {
    render() {
        return (
            <form style={{ display: 'flex' }}>
                <input 
                    type="text"
                    name="title"
                    placeholder="Add Todo..."
                    style={{ flex: '2', padding: '3px'}}
                />
                <input 
                    type="submit"
                    style={{ 
                        cursor: 'pointer', 
                        border: 'none', 
                        padding: '3px 5px',
                        backgroundColor: 'blue',
                        color: 'white'
                    }}
                />
            </form>
        )
    }
}

export default AddTodo
